import axios from 'axios';

async function userList(){
  const userList = await axios.get('http://localhost:5000/users');
  console.log(userList.data);
  return userList;
}

const UsersList = () =>{
  userList()
  return (
    <div>
      <h1>Users List</h1>
    </div>
  );
}

async function user(){
  const User = await axios.get('http://localhost:5000/user');
  console.log(User.data);
  return User.data;
}

const User = () =>{
  user();
  return (
    <div>
      <h1>Single User Request</h1>
    </div>
  );
} 

export { UsersList, User };
